import React from 'react';
import { Link, useHistory } from 'react-router-dom';
import './navigation.css';

export const Navigation = () => {
  const history = useHistory();

  const handleLogout = () => {
    // Perform logout actions if needed
    // For example, clearing user authentication token, state, or any other cleanup

    // Uncomment and add your logout logic below
    // clearUserAuthenticationToken();
    // resetUserState();
    // ...

    // Replace the current entry in the history stack with the home page
    history.replace('/');
  };

  return (
    <div className="navcontainer">
      <h1>USER</h1>
      <div className="navigation">
        <Link to="/UserBook">
          <p className="p1">APPOINTMENT</p>
        </Link>
        <Link to="/Userchat">
          <p className="p1">CHAT</p>
        </Link>
        <Link to="/UserMedicene">
          <p className="p1">MEDICINE</p>
        </Link>
        <button onClick={handleLogout} className="p1">
          Logout
        </button>
      </div>
    </div>
  );
};
